        public void Initialize_grp_位置與IO_ChildControlChanged_Listener(GroupBox groupBox)
        {
            foreach (Control control in groupBox.Controls)
            {
                switch (control)
                {
                    case TextBox textBox:

                        switch (textBox.Name)
                        {
                            case "txt_拋料":
                                control.KeyPress += grp_IO按鍵判斷;
                                break;
                            case "txt_開真空":
                                control.KeyPress += grp_IO按鍵判斷;
                                break;
                            default:
                                control.KeyPress += grp_位置按鍵判斷;
                                break;
                        }

                        break;
                    default:
                        break;
                }
            }
        }
